import pytest, time


# correct bug(s) in the solution_original function
# max. of 4 lines may be edited

def original_solution(S, start_time):
    occurrences = [0] * 26

    for i in range(len(S)):
        occurrences[ord(S[i]) - ord('a')] += 1

    print("After searching text: --- %s seconds ---" % (
            time.time() - start_time))

    best_char = 'a'
    best_res = occurrences[ord(S[i]) - ord('a')]

    for i in range(1, 26):
        if occurrences[i] >= best_res:
            best_char = chr(ord('a') + i)
            best_res = occurrences[i]

    return best_char


def optimized_solution(S, start_time):
    occurrences = [0] * 26

    # looping through a 100.000 char text string takes about 99.99% of the time
    # optimization must occur here
    for i in range(len(S)):
        occurrences[ord(S[i]) - ord('a')] += 1

    print("After searching text: --- %s seconds ---" % (
            time.time() - start_time))

    best_char = 'a'
    best_res = occurrences[0]  # bug2: must be 0

    for i in range(1, 26):
        if occurrences[i] > best_res:  # bug1: must be >
            best_char = chr(ord('a') + i)
            best_res = occurrences[i]

    return best_char


def my_test_solution(S, start_time):
    occurrences = [0] * 26

    for i in range(len(S)):
        occurrences[ord(S[i]) - ord('a')] += 1

    print("After searching text: --- %s seconds ---" % (
                time.time() - start_time))

    best_char = 'a'
    best_res = 0

    for i in range(0, 26):
        if occurrences[i] > best_res:
            best_char = chr(ord('a') + i)
            best_res = occurrences[i]

    return sorted(best_char)[0]


