def test_maximum_letters_original_solution():
    print(test_maximum_letters_original_solution.__name__)
    start_time = time.time()

    file = open("100Klongstring.txt", "r")
    data = file.read()
    result = original_solution(data, start_time)

    assert result == "f"

    print("--- %s seconds ---" % (time.time() - start_time))


def test_maximum_letters_optimized_solution():
    print(test_maximum_letters_optimized_solution.__name__)
    start_time = time.time()

    data = ""
    result = optimized_solution(data, start_time)

    assert result == "f"

    print("--- %s seconds ---" % (time.time() - start_time))


def test_maximum_letters_my_test_solution():
    print(my_test_solution.__name__)
    start_time = time.time()

    data = ""
    result = my_test_solution(data, start_time)

    assert result == "f"

    print("--- %s seconds ---" % (time.time() - start_time))


